	('0b6ebcdb-14a3-4c26-8ac2-ab789c45db55', 'product eye', '<p>The official Tiptap v2 extension for unordered lists is <strong>@tiptap/extension-bullet-list</strong>. There isnt an official extension called <strong>@tiptap/extension-list</strong> in Tiptap v2. Instead, Tiptap provides separate extensions for bullet lists, ordered lists, and list items:</p><ul class="list-disc pl-8 space-y-2"><li><p><strong>@tiptap/extension-bullet-list:</strong> Handles unordered (bulleted) lists.</p></li><li><p><strong>@tiptap/extension-ordered-list:</strong> Handles ordered (numbered) lists.</p></li><li><p><strong>@tiptap/extension-list-item:</strong> Manages the individual list items.adfa</p></li></ul><p>If you come across <strong>@tiptap/extension-list</strong> somewhere, it might refer to a custom or community solution or be a misnomer. For standard list functionality in Tiptap, use the specific extensions listed above.</p>', 1000, 'skin-care', '{https://nqzcokqdvmmlysnyaclc.supabase.co/storage/v1/object/public/product-images/1742517364885_272e6f4164b146909b1285f09546f357.jpg,https://nqzcokqdvmmlysnyaclc.supabase.co/storage/v1/object/public/product-images/1742517374249_9ef83a74e76b4f26b6d78228ba076ba6.jpg}', 100, true, true, '2025-03-21 00:37:31.484333+00', 'product-1', '<p>A gentle, yet hard-working jelly cleanser that cleanses skin and dissolves (water-soluble) makeup, while being respectful to the skin barrier.&nbsp;</p><p>5.07 fl. oz. (150 ml), pH 4.8-5.4</p><p><strong><em>Skin type:</em></strong> all skin types, including sensitive</p><p><strong><em>Skin concern:</em></strong> can be used regardless&nbsp;of skin concern</p><p>Cruelty-free&nbsp;| Vegan&nbsp;| Fragrance &amp; Essential oil free | Gluten-free | Malassezia-safe | Pregnancy-safe</p>');
